import React,{useState} from 'react';
import {Button,Input} from 'antd';
import {render}  from 'react-dom';
const Inputs= function(props) {
    const [name,setName] = useState('');
    const [content,setContent] = useState('');
    const [url,setUrl] = useState('');
    const [source,setSource] = useState('');
    const [type,setType] = useState('');

    const click = () => {

        const data = {name,content,url,source,type}
        fetch ('http://localhost:8070/add',{
            method:'POST',
            body:JSON.stringify(data),
        })
        props.history.replace('/');
    }

    const cancel = () => {
        props.history.replace('/');
    }


    return (
        <div style={{marginLeft:'200px',width:"50px"}}>
            <Input style={{width:500}} style={{marginTop:'30px'}} placeholder="name" onChange={(e) => {setName(e.target.value)}}/>
            <Input style={{width:500}} style={{marginTop:'30px'}} placeholder="content" onChange={(e) => {setContent(e.target.value)}}/>
            <Input style={{width:500}} style={{marginTop:'30px'}} placeholder="url" onChange={(e) => {setUrl(e.target.value)}}/>
            <Input style={{width:500}} style={{marginTop:'30px'}} placeholder="source" onChange={(e) => {setSource(e.target.value)}}/>
            <Input style={{width:500}} style={{marginTop:'30px'}} placeholder="type" onChange={(e) => {setType(e.target.value)}}/>
            <div>    
                <Button style={{marginTop:'30px'}} onClick={click} type='primary'>提交</Button>
                <Button style={{marginTop:'30px'}} onClick={cancel} type='primary'>取消</Button>
            </div> 
        </div>
    )
}
export default Inputs
